import {motion} from "framer-motion"

export const Animate=()=>{
    return(
        <div className="">
            <motion.div
                animate={{
                    x: 0,
                    backgroundColor: "#",
                    boxShadow: "10px 10px 0 rgba(0, 0, 0, 0.2)",
                    position: "fixed",
                    transitionEnd: {
                    display: "none",
                    },
                }}
                />
        </div>
    )
}
